pragma solidity ^0.8.0;

contract MyContract {

    address[16] public tikets;
    uint public balanceWei = 0;

    address payable public admin  = payable(0x50d3b84a2b1787b7704DD50c67733b6b5B293629);

    address[16] public tiketBookers; 
    uint[16] public tiketsBookedTime; 

    function withdrawBalance () public {
        require(msg.sender == admin, "No eres el admin");
        
        admin.transfer(balanceWei);
        balanceWei = 0;
    }

    function getBalance() public view returns (uint256) {

        return payable(address(this)).balance;
    }

    function getBalanceWei() public view returns (uint256) {

        return balanceWei;
    }

    /**
    
        Funcin para cambiar el administrador
    
     */
    function changeAdmin(address newAdmin) public payable returns (bool) {
        require(msg.sender == admin, "No eres el admin");
        admin = payable(newAdmin);
        
        return true;
    }

    /**
    
        Funcin para comprar un ticket
    
     */
    function buyTiket(uint tiketIndex) payable public returns (bool) {
        
        require(tiketIndex >= 0 && tiketIndex <= 15);

        require(tikets[tiketIndex] == address(0), "Este ticket ya ha sido comprado");

        require(msg.value > 0.01 ether, "Cantidad insuficiente de BNB");
        balanceWei += msg.value;


        bool sucess = true;
        
        if ( tikets[tiketIndex] == address(0) ){
            
            tikets[tiketIndex] = msg.sender;
        } else {
            sucess = false ;
        }

        return sucess;
    }

    /**
    
        Funcin para obtener los tickets
    
     */
    function getTikets() public view returns (address[16] memory) {
        return tikets;
    }

    /**
    
        Funcin para cambiar el propietario de un ticket
    
     */
    function changeTiketOwner(uint ticketId, address newOwner) public {
        require(ticketId >= 0 && ticketId <= 15, "El ticket no existe");

        require(msg.sender == tikets[ticketId],"Tu no eres el propietario del ticket");

        tikets[ticketId] = newOwner;
    }

    /**
    
        Funcin para reservar tickets
    
     */
    function bookTiket(uint tiketIndex) public returns (bool) {
    
        require(tiketIndex >= 0 && tiketIndex <= 15, "El ticket no existe");

        require(tikets[tiketIndex] == address(0), "Este ticket ya ha sido comprado");

        uint currentTicketTime = block.timestamp;

        require(tiketsBookedTime[tiketIndex] + 120 < currentTicketTime, "Este ticket ya ha sido reservado");
        
        tiketBookers[tiketIndex] = msg.sender;
        tiketsBookedTime[tiketIndex] = currentTicketTime;

        return true;
    }

}
